import { useState } from 'react';

function Counter () {
  const [counter, setCounter] = useState(0);

  const onClickCounter = () => {
    setCounter(counter + 1)
    console.log('+');
  };

  return (
    <div>
      <p>
        <button onClick ={onClickCounter}>+1 Button</button>
        {counter}
      </p>
    </div>
  );
}

export default Counter;
